import React from "react";
import Play from "./components/play";

class Users extends React.Component {
  render() {
    return (
      <div>
        <div id="InputForm">
          <form>
            <input id="nameOne" type="text" placeholder="Your name" />
            <input id="selectX" type="button" value="X" />
            <input id="selectO" type="button" value="O" />
            <br />
            <br />
            <input id="nameTwo" type="text" placeholder="Your name" />
            <label>X</label>
            <br />
            <br />
          </form>
        </div>
        <div>
          <button id="start">START</button>
        </div>
      </div>
    );
  }
}
export default Users;
